import React from 'react';
import '../../App.css';

import ScriptsHead from '../ScriptsHead';
import ScriptContent from '../ScriptContent';
import Footer from '../Footer';


export default function Scripts() {
  return (
  	<>
  		<ScriptsHead />
  		<ScriptContent />
  		<Footer />
  	</>
  );
}
